export default (state=[], action) => {
	console.log('appoint', action.type, state)
	switch (action.type) {
		case 'INIT_APPOINTMENT':
      return {departments: []};

		case 'LOAD_APPOINTMENT':
			return {departments: []};

		case 'LOAD_APPOINTMENT_SUCCESS':
			return {departments: []};

		case 'DELETE_APPOINTMENT':
			return {departments: action.payload};

		case 'DELETE_APPOINTMENT_SUCCESS':
			return {departments: []};

		default:
      return state
	}
};
